package cn.com.evo.integration.qinghai.sdk.request;import cn.com.evo.integration.common.request.AuthRequest;/** * @Description: * @author: lu.xin * @create: 2019-04-19 2:02 PM **/public class QingHaiAuthRequest extends AuthRequest {    public static QingHaiAuthRequest playAuthInit(String cardNo,                                                  String appId, String columnId, String contentId,                                                  String childContentId) {        QingHaiAuthRequest request = new QingHaiAuthRequest();        request.setCardNo(cardNo);        request.setAppId(appId);        request.setColumnId(columnId);        request.setContentId(contentId);        request.setChildContentId(childContentId);        return request;    }}